import { ButtonGroup, Grid } from "@mui/material";

export default function Header(){
    return(
        <Grid>
            <div>
            <ButtonGroup variant="text" aria-label="Basic button group">
        <Button>One</Button>
        <Button>Two</Button>
        <Button>Three</Button>
      </ButtonGroup>
            </div>
        </Grid>
    )
}
